import React, { useState } from "react";
import ClothesList from "../components/ClothesList.js";
import ClothesInfoModal from "../components/ClothesInfoModal.js";

const ShirtPage = ({ onClose, openInfoModal }) => {
  const [clothesInfoModalOpen, setClothesInfoModalOpen] = useState(false);

  return (
    <>
      {clothesInfoModalOpen && (
        <ClothesInfoModal onClose={() => setClothesInfoModalOpen(false)} />
      )}
      <h1>Shirts Page</h1>
      <div className="flex flex-wrap justify-evenly m-4">
        <ClothesList clothingtypeID="tops" onClick={openInfoModal} />
      </div>
    </>
  );
};

export default ShirtPage;
